import HighlightImage from "./assets/highlight.png";

function App() {
  return (
    <div>
      <div style={{ maxWidth: 500, margin: "0% auto" }}>
        <img
          src={HighlightImage}
          alt="aakash cover pic"
          style={{ width: "100%" }}
        />
        <p>Hi, I'm Aakash Adesara.</p>
        <p>
          I'm a California based engineer building in healthcare, venture, and
          crypto. In the past, I've been to 80+ hackathons, built rockets, and
          created some digital art. I love road biking, lo-fi instrumental
          music, and detailed animations.
        </p>
        <p>
          Currently, I am a growth engineer at Athelas, a fast-growing venture
          backed healthcare company pushing the boundaries of modern healthcare.
          Outside of work, I started and run a startup newsletter called
          DailyDropout.FYI with 40k+ community members.
        </p>
      </div>
    </div>
  );
}

export default App;
